import React from 'react'
import Post6B from '../../../Pages/Post/Post6B'
import Post5B from '../../../Pages/Post/Post6B'
import styles from './HomeContainer.module.css'
import SpecialPost from '../'


export default function HomeContainer (props) {
    return (
        <div className={styles.homeContainer}>
            <div className={styles.post6Block}>
                {props.posts.map((params,id)=>(
                    <Post6B key={id} id={id++} post={params}/>
                ))}
            </div>
            <div className={styles.post5Block}>
                {props.posts.map((params,id)=>(
                    <>{id++ === 0 || id++ === 4 ? <SpecialPost post={params}/>: <NormalPost post={params}/>}</>
                    // <Post5B key={id} id={id++} post={params}/>
                ))}
            </div>
            
        </div>
    )
}
